insert into web_forum_database.posts (post_id, title, content, user_id, created_on, is_deleted, likes, dislikes) values (1, 'Understanding Java Multithreading', 'Multithreading is a crucial aspect of Java programming, allowing concurrent execution of tasks. It enhances performance by efficiently utilizing system resources.', 3, '2024-02-18 20:10:01', 0, 1, 1);
insert into web_forum_database.posts (post_id, title, content, user_id, created_on, is_deleted, likes, dislikes) values (2, 'Exploring Java Spring Framework', 'The Spring Framework simplifies Java development by providing comprehensive infrastructure support. With features like dependency injection, it promotes modular and testable code.', 7, '2024-02-18 20:10:02', 0, 3, 1);
insert into web_forum_database.posts (post_id, title, content, user_id, created_on, is_deleted, likes, dislikes) values (3, 'Java Design Patterns for Scalability', 'Applying design patterns is essential for building scalable Java applications. Patterns like Singleton and Observer contribute to creating robust and efficient systems.', 1, '2024-02-18 20:10:02', 0, 3, 1);
insert into web_forum_database.posts (post_id, title, content, user_id, created_on, is_deleted, likes, dislikes) values (4, 'Effective Exception Handling in Java', 'Exception handling is a critical part of Java programming. By using try-catch blocks, developers can manage runtime errors and ensure graceful application behavior.', 8, '2024-02-18 20:10:02', 0, 4, 1);
insert into web_forum_database.posts (post_id, title, content, user_id, created_on, is_deleted, likes, dislikes) values (5, 'Mastering Java Collections Framework', 'Java Collections offer a versatile set of data structures. From Lists to Maps, understanding and utilizing these classes is key for efficient data manipulation. Really cool!', 6, '2024-02-18 20:10:02', 0, 4, 1);
insert into web_forum_database.posts (post_id, title, content, user_id, created_on, is_deleted, likes, dislikes) values (6, 'Secure Coding Practices in Java', 'Security is paramount in Java development. Adhering to secure coding practices helps prevent vulnerabilities and ensures the integrity of your applications.', 2, '2024-02-18 20:11:32', 0, 3, 1);
insert into web_forum_database.posts (post_id, title, content, user_id, created_on, is_deleted, likes, dislikes) values (7, 'JavaFX: Building Modern User Interfaces', 'JavaFX provides a platform for creating rich, interactive user interfaces. With features like FXML and CSS styling, developers can build modern and visually appealing applications.', 9, '2024-02-18 20:13:07', 0, 2, 2);
insert into web_forum_database.posts (post_id, title, content, user_id, created_on, is_deleted, likes, dislikes) values (8, 'Java Networking: Socket Programming', 'Understanding socket programming is essential for building networked applications in Java. It enables communication between distributed systems through the use of sockets.', 4, '2024-02-18 20:10:03', 0, 5, 1);
insert into web_forum_database.posts (post_id, title, content, user_id, created_on, is_deleted, likes, dislikes) values (9, 'Optimizing Java Code for Performance', 'Performance optimization is a continuous process in Java development. Techniques like code profiling and efficient algorithm implementation contribute to faster and more responsive applications.', 5, '2024-02-18 20:10:03', 0, 3, 1);
insert into web_forum_database.posts (post_id, title, content, user_id, created_on, is_deleted, likes, dislikes) values (10, 'Unit Testing in Java with JUnit', 'JUnit is a powerful testing framework for Java. Adopting unit testing practices ensures the reliability and correctness of your code throughout the development process.', 10, '2024-02-18 20:10:03', 0, 4, 1);
insert into web_forum_database.posts (post_id, title, content, user_id, created_on, is_deleted, likes, dislikes) values (11, 'Java Stream API: Functional Programming', 'The Stream API in Java facilitates functional programming paradigms. Leveraging streams allows developers to write concise and expressive code for data manipulation.', 3, '2024-02-18 20:10:02', 0, 1, 1);
insert into web_forum_database.posts (post_id, title, content, user_id, created_on, is_deleted, likes, dislikes) values (12, 'Developing RESTful APIs with Java', 'Building RESTful APIs is a common requirement in Java development. Technologies like Spring Boot simplify the process, enabling developers to create scalable and robust APIs.', 7, '2024-02-18 20:10:02', 0, 1, 1);
insert into web_forum_database.posts (post_id, title, content, user_id, created_on, is_deleted, likes, dislikes) values (13, 'Concurrency Challenges in Java Programming', 'Concurrency introduces challenges in Java development. Addressing issues such as race conditions and deadlock is crucial for building stable and reliable concurrent applications.', 1, '2024-02-18 20:10:02', 0, 1, 1);
insert into web_forum_database.posts (post_id, title, content, user_id, created_on, is_deleted, likes, dislikes) values (14, 'Java 17 Features: What is New?', 'Java 17 introduces new features and enhancements. From pattern matching to sealed classes, staying updated on the latest language improvements is essential for modern Java development.', 6, '2024-02-18 20:10:02', 0, 1, 1);
insert into web_forum_database.posts (post_id, title, content, user_id, created_on, is_deleted, likes, dislikes) values (15, 'Java Memory Management Best Practices', 'Effective memory management is vital for preventing memory leaks and optimizing Java applications. Understanding concepts like garbage collection contributes to efficient resource utilization.', 8, '2024-02-18 20:10:02', 0, 1, 1);
insert into web_forum_database.posts (post_id, title, content, user_id, created_on, is_deleted, likes, dislikes) values (16, 'Building Microservices with Spring Boot', 'Microservices architecture is a popular approach in Java development. Using Spring Boot, developers can create modular and scalable microservices for building robust distributed systems.', 2, '2024-02-18 20:10:02', 0, 1, 1);
insert into web_forum_database.posts (post_id, title, content, user_id, created_on, is_deleted, likes, dislikes) values (17, 'Java 3D Graphics Programming', 'Java supports 3D graphics programming through libraries like JOGL. Developing applications with 3D visualization enhances the user experience and opens up possibilities for innovative interfaces.', 9, '2024-02-18 20:10:02', 0, 1, 1);
insert into web_forum_database.posts (post_id, title, content, user_id, created_on, is_deleted, likes, dislikes) values (18, 'Java Security Best Practices', 'Ensuring the security of Java applications requires adherence to best practices. Techniques such as input validation and secure coding guidelines help protect against common vulnerabilities.', 4, '2024-02-18 20:10:02', 0, 1, 1);
insert into web_forum_database.posts (post_id, title, content, user_id, created_on, is_deleted, likes, dislikes) values (19, 'Java Servlets and JSP: Web Development', 'Servlets and JSP are fundamental technologies for Java web development. They enable the creation of dynamic and interactive web applications by processing requests and generating dynamic content.', 5, '2024-02-18 20:10:02', 0, 1, 1);
